import React,{Component} from 'react';
//style importer
// import * as style from './style';
//component importer
//utils importer

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string
}
class MainMenu extends Component<{},State>{

    state = initState

    render(){
        return (
            <h1>Main Menu</h1>
        )
    }
}

export default MainMenu;
